/* eslint no-unused-vars: 0 */
import ifDefined from '@ui5/webcomponents-base/dist/renderer/ifDefined.js';
import { html, svg, repeat, classMap, styleMap } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';
const block0 = (context) => { return html`<div	class="ui5-dp-root"	style="${styleMap(context.styles.wrapper)}"	@keydown=${context._onkeydown}	@mousedown=${context._onmousedown}	@mouseup=${context._onmouseup}>	${ context.showWeekNumbers ? block1(context) : undefined }<div id="${ifDefined(context._id)}-content" class="ui5-dp-content"><div role="row" class="ui5-dp-days-names-container">			${ repeat(context._dayNames, (item, index) => item._id || index, (item, index) => block3(item, index, context)) }</div><div id="${ifDefined(context._id)}-days" class="ui5-dp-items-container" tabindex="-1">			${ repeat(context._weeks, (item, index) => item._id || index, (item, index) => block4(item, index, context)) }</div></div></div>`; };
const block1 = (context) => { return html`<div class="ui5-dp-weeknumber-container">			${ repeat(context._weekNumbers, (item, index) => item._id || index, (item, index) => block2(item, index, context)) }</div>	`; };
const block2 = (item, index, context) => { return html`<div class="ui5-dp-weekname-container"><span class="ui5-dp-weekname">${ifDefined(item)}</span></div>			`; };
const block3 = (item, index, context) => { return html`<div					id=${ifDefined(item.id)}					role="columnheader"					aria-label="${ifDefined(item.name)}"					class="${ifDefined(item.classes)}">					${ifDefined(item.ultraShortName)}</div>			`; };
const block4 = (item, index, context) => { return html`${ item.length ? block5(item, index, context) : block7(item, index, context) }`; };
const block5 = (item, index, context) => { return html`<div style="display: flex;">						${ repeat(item, (item, index) => item._id || index, (item, index) => block6(item, index, context)) }</div>				`; };
const block6 = (item, index, context) => { return html`<div								id="${ifDefined(item.id)}"								tabindex="${ifDefined(item._tabIndex)}"								data-sap-timestamp="${ifDefined(item.timestamp)}"								data-sap-index="${ifDefined(item._index)}"								role="gridcell"								aria-selected="${ifDefined(item.selected)}"								class="${ifDefined(item.classes)}"><span										class="ui5-dp-daytext"										data-sap-timestamp="${ifDefined(item.timestamp)}"										data-sap-index="${ifDefined(item._index)}">											${ifDefined(item.iDay)}</span></div>						`; };
const block7 = (item, index, context) => { return html`<div class="sapWCEmptyWeek"></div>				`; };

export default block0;
